// Parent - Main.js

import Skeleton from "@mui/material/Skeleton";
import React from "react";

import classes from "../../ui/SwiperSlideUI.module.css";

function BodySkeleton() {
  return (
    <div style={{ display: 'inline'}}>
      <Skeleton
        height={250}
        width="20%"
        animation="wave"
        variant="rectangular"
      />
      <Skeleton
        sx={{ height: 250, width: "20%", mr: 30 }}
        animation="wave"
        variant="rectangular"
      />
      <Skeleton
        sx={{ height: 250, width: "20%", mr: 30 }}
        animation="wave"
        variant="rectangular"
      />
      <Skeleton
        sx={{ height: 250, width: "20%", mr: 30 }}
        animation="wave"
        variant="rectangular"
      />
      <Skeleton
        sx={{ height: 250, width: "20%", mr: 30 }}
        animation="wave"
        variant="rectangular"
      />
    </div>
  );
}

export default BodySkeleton;
